import { useEffect, useRef, useState } from 'react';

import HeartIcon from 'assets/icons/heart-outlined.svg';
import { useObserver } from 'hooks/useObserver';

import {
  Icon,
  Image,
  Infomation,
  Likes,
  Posting,
  Price,
  TimeAndPlace,
  Title,
} from './MarketList.style';
import { Link } from 'react-router-dom';

export const MarketList = () => {
  const [postingList, setPostingList] = useState([]);
  const [page, setPage] = useState(0);
  useEffect(() => {
    setPostingList([...postingList, ...mockDatas]);
  }, [page]);

  const { observe } = useObserver(() => setPage((page) => page + 1));
  const target = useRef(null);
  useEffect(() => {
    observe(target.current);
  }, []);

  return (
    <>
      {postingList.map((post, i) => (
        <Link to={`./${post.id}`} key={i}>
          <Posting>
            <Image src={post.image} />
            <Infomation>
              <Title>{post.title}</Title>
              <TimeAndPlace>
                {post.location}・{post.postedAt}
              </TimeAndPlace>
              <Price>{post.price.toLocaleString('en-US')}원</Price>
              <Likes>
                <Icon src={HeartIcon} />
                {post.likes}
              </Likes>
            </Infomation>
          </Posting>
        </Link>
      ))}
      <div ref={target}></div>
    </>
  );
};

